import React from 'react'
import Navbar from './component /Navbar'
import { BrowserRouter as Router, Switch , Route, Routes } from "react-router-dom";
import Home from './component /Home';

function App() {
  return (
    <>
      <Navbar/>

      <Router>
        <Routes>
          <Route path="/" element={<Home/>}  />
        </Routes>
      </Router>


    </>
  )
}

export default App
